import React from "react";
import "./Square.css";

export default function Square({
  width = 42,
  height = 42,
  colors = ["grey", "black"],
}) {
  return (
    <div
      style={{
        width: `${width}px`,
        height: `${height}px`,
        transform: `rotate(${Math.ceil(Math.random() * 360)}deg)`,
        position: "relative",
      }}
      className="square"
    >
      <div
        style={{
          width: `${(5 * width) / 6}px`,
          height: `${(5 * height) / 6}px`,
          border: `2px solid ${colors[0]}`,
        }}
      ></div>
      <div
        style={{
          width: `${(5 * width) / 6}px`,
          height: `${(5 * height) / 6}px`,
          background: colors[1],
          position: "absolute",
          bottom: 0,
          right: 0,
        }}
      ></div>
    </div>
  );
}
